import React, {Component} from "react"
import Particles from "react-particles-js";

class Secondary extends Component {
  render() {
    return (
      <div className="particle">
        <Particles
          params={{
            polygon: {
              enable: true,
              type: "inside",
              move: {
                radius: 10,
              },

            },
          }}
        />
        />
      </div>
    );
  }
}

export default Secondary
